import React from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";

const PageOne = () => {
  return (
    <div>Page One
      <Link to="/pagetwo">Navigate to page 2</Link>
    </div>
  );
};
const PageTwo = () => {
  return (
    <div>
      Page Two
      <Link to="/pagethree">Navigate to page 3</Link>
      <button> Click me</button>
    </div>
  );
};
const PageThree = () => {
  return (
    <div>Page Three
      <Link to="/">Navigate to page 1</Link>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact={true} component={PageOne} />
        <Route path="/pagetwo" component={PageTwo} />
        <Route path="/pagethree" component={PageThree} />
      </BrowserRouter>
    </div>
  );
};

export default App;
